USE hrm;

CREATE TABLE `tb_pph` (
  `tbpph_id` int(11) NOT NULL AUTO_INCREMENT,
  `tbe_id` int(11) DEFAULT NULL,
  `tbpph_date` datetime DEFAULT NULL,
  `tbpph_ptkp` double DEFAULT NULL,
  `tbpph_salary` double DEFAULT NULL,
  `tbpph_jkkjkm` double DEFAULT NULL,
  `tbpph_npwp_awal_tahun` int(11) DEFAULT NULL,
  `tbpph_gaji_pokok_gross` double DEFAULT NULL,
  `tbpph_tunjangan_tetap` double DEFAULT NULL,
  `tbpph_tunjangan_jamsostek_jkkjkm` double DEFAULT NULL,
  `tbpph_total_gross` double DEFAULT NULL,
  `tbpph_iuran_jht_jamsostek` double DEFAULT NULL,
  `tbpph_biaya_jabatan` double DEFAULT NULL,
  `tbpph_pend_sbln_sblm_pajak` double DEFAULT NULL,
  `tbpph_pend_ytd_sblm_pajak_smp_bln_lalu` double DEFAULT NULL,
  `tbpph_pajak_disetor_ytd_smp_bln_lalu` double DEFAULT NULL,
  `tbpph_faktor_pengali_utk_disetahunkan` double DEFAULT NULL,
  `tbpph_pendapatan_disetahunkan` double DEFAULT NULL,
  `tbpph_pendapatan_kena_pajak` double DEFAULT NULL,
  `tbpph_pajak_setahun_utk_kary_ber_npwp` double DEFAULT NULL,
  `tbpph_pajak_setahun_utk_kary_tdk_ber_npwp` double DEFAULT NULL,
  `tbpph_pajak_terutang_smp_bln_ini` double DEFAULT NULL,
  `tbpph_pajak_bln_ini` double DEFAULT NULL,
  `tbpph_take_home_pay` double DEFAULT NULL,
  `tbpph_pendapatan_tidak_tetap` double DEFAULT NULL,
  `tbpph_pendapatan_tidak_tetap_ytd` double DEFAULT NULL,
  `tbpph_pajak_sdh_disetor_utk_pend_tdk_ttp_ytd` double DEFAULT NULL,
  `tbpph_pend_disetahunkan_plus_komisi` double DEFAULT NULL,
  `tbpph_pajak_tot_sethn_utk_kary_ber_npwp` double DEFAULT NULL,
  `tbpph_pajak_tot_sethn_utk_kary_tdk_ber_npwp` double DEFAULT NULL,
  `tbpph_pajak_komisi` double DEFAULT NULL,
  `tbpph_take_home_pay_utk_pend_irreguler` double DEFAULT NULL,
