  `tbpph_total_take_home_pay` double DEFAULT NULL,
  `tbc_id` int(11) DEFAULT NULL,
  `tbpph_total_take_home_pay_kurs` double DEFAULT NULL,
  `tbpph_periode` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`tbpph_id`),
  KEY `tbpph_fk_1` (`tbe_id`),
  KEY `tbpph_fk_2` (`tbc_id`),
  CONSTRAINT `tbpph_fk_1` FOREIGN KEY (`tbe_id`) REFERENCES `tb_employee` (`tbe_id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `tbpph_fk_2` FOREIGN KEY (`tbc_id`) REFERENCES `tb_currency` (`tbc_id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=latin1;


